  false,\n\t\"url\": null,\n\t\"notes\": \"Ruby Lake NWR 1990 Annual Water Management
  Report 1991 Annual Water Management Plan. Includes 1990 weather summary, water availability
  forecast, summary of 1990 water levels, effects of 1990 water levels on the ecology
  of each management unit, and objectives for 1991. Precipitation the last six years
  (1985-1990) has been below the 12.75 inch 50-year average. During 1988, 1989 and
  1990. only 9.79, 9.36 and 9.73 inches of precipitation were received. With these
  low amounts in addition to poor surface and ground water storage from the previous
  below normal years. it is believed water shortages will continue to be extreme.
  The forecast is not encouraging for the upcoming year. There will probably be adequate
  water to maintain the small diked units at objective levels. The excess water will
  flow into the South Sump. This amount w111 not have a significant effect on the
  water levels in this 7300 acre area. Flows into the North Sump and East Sump will
  be minimum.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
